import styled from "styled-components";

export const StyledList = styled.ul`
  font-size: 1.25rem;
  color: ${(props) => props.theme.thirdC};
  font-family: ${(props) => props.theme.secondaryF};
  line-height: 2rem;
  list-style: none;
`;
